import React from 'react';
import { useLocation } from 'react-router-dom';

const UserDashboard = () => {
    const location = useLocation();
    const user = location.state?.user; // Use optional chaining to avoid errors if state is undefined
    
    if (!user) {
        return <div>User information is not available. Please log in again.</div>;
    }
    return (
        <div>
            <h2>Welcome, {user.user_profile?.name || 'User'}</h2>
            <p><strong>Account Number:</strong> {user.account_number || 'N/A'}</p>
            <p><strong>ATM Card Number:</strong> {user.atm_card_number || 'N/A'}</p>
            <p><strong>IFSC Code:</strong> {user.ifsc_code || 'N/A'}</p>
            <p><strong>Location:</strong> {user.user_profile?.location || 'N/A'}</p>
        </div>
    );
};

export default UserDashboard;
